// IsSentenceBreakClose reports whether the rune has property "Sentence_Break"="Close".
// Property "Sentence_Break" known as "SB", "Sentence_Break".
// Value "Close" known as "CL", "Close".
func IsSentenceBreakClose(r rune) bool {
	const lo = 0x22
	const hi = 0x1f678
	if r < lo || r > hi {
		return false
	}
	var i = (r - lo) / 64
	var shift = (r - lo) % 64
	return dataArrayIsSentenceBreakClose[i]&(1<<uint(shift)) != 0
}

